var pyuseridtag="pyuserid";var pyuseridlife=1;var debug_flag=false;function setCookie(a,d,b){var e=new Date();e.setDate(e.getDate()+b);var c=escape(d)+((b==null)?"":"; expires="+e.toUTCString());document.cookie=a+"="+c}function getCookie(b){var c=document.cookie;var d=c.indexOf(" "+b+"=");if(d==-1){d=c.indexOf(b+"=")}if(d==-1){c=null}else{d=c.indexOf("=",d)+1;var a=c.indexOf(";",d);if(a==-1){a=c.length}c=unescape(c.substring(d,a))}return c}function checkCookie(a){if(a!=null&&a!=""){debug("pyuserid already created")}else{var b=GUID();setCookie(pyuseridtag,b,pyuseridlife);console.log(getCookie(pyuseridtag))}}function GUID(){var a="xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx".replace(/[xy]/g,function(e){var d=Math.random()*16|0,b=e=="x"?d:d&3|7;return b.toString(16)});return a};